import React from "react";
import {useQuery, gql} from "@apollo/client";

const get_Category = gql`
query{
categories{
  products{
    description
  }

  }
}`
function App() {

  const {data} = useQuery(get_Category);
  console.log({data});
  return (
    <div className="App">
      {data.cateproducts.map(category => {
        return <h1>{category.description}</h1>
      })}

    </div>
  );
}

export default App;
